                  {/* Add your content here */}
                </div>
                <div className="section">
                  <h2>About PharamLore</h2>
                  <p>Learn more about us and our mission to provide valuable health information.</p>
                  {/* Add your content here */}
                </div>
                {/* Add more sections as needed */}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
